TWICE MINA x Harper’s BAZAAR Behind The Scenes!!! MINA’s visuals are incredibly stunning!!! MINA said it was important to not be shy during a photoshoot, but being bold and that she tried everything she wanted to do!!! She succeeded perfectly in showing powerful and bold sides of her!!! Her expressions are magnificent and every picture of her deserves to be in a museum of art!!! The outfits fit MINA perfectly and she highlights the key points of the outfits in a unique and exciting way!!! MINA’s adorable gummy smile fills my heart up with love, joy and happiness always!!! Thank You MINA For Filming Your First Solo Magazine Photoshoot, You Showed Marvelous Visuals And Colours In An Unforgettable, Legendary, Best Way!!! True Perfection!!! Listening to MINA saying she was nervous before the photoshoot, but that’s she’s enjoying it and having fun makes me so incredibly happy!!! OT9 TWICE FOREVER X♾!!!!!❤❤❤❤❤ TWICE are the best x♾ and my everything x♾ always x♾!!! Thank You And I Love You So Incredibly Much x♾ Always x♾ TWICE!!!❤️❤️❤️ Let's be together always x♾ TWICE and ONCE and make beautiful x♾ memories together forever x♾!!! I hope you're always x♾ feeling the best x♾ in the whole universe TWICE!!! Thank You For Working So Incredibly Hard TWICE, Please Always x♾ Remember To Rest And Relax Well Too!!! Please stay strong, safe, happy and healthy x♾ always x♾ TWICE and ONCE!!!!!❤️❤️❤️❤️❤️
